var b = b || utag.data;
if (b['dom.title'] == 'Tealium Tag Sandbox') {
  // make sure not to overwrite real opt-out cookie settings
  if (b.hasOwnProperty('cp.OPTOUTMULTI') == false) {
    // get the tag ID of the only tag that should be loaded in this sandbox
    var tag_id = tag_path.split(&quot;/&quot;)[tag_path.split(&quot;/&quot;).length - 1];
    // get an array of the tags that TiQ wants to load
    var tag_list = Object.keys(utag.loader.cfg);

    var arr = [];
    // don't opt out of tealium cookies
    arr.push(&quot;0:1&quot;);

    for (var i = 0; i &lt; tag_list.length; i++) {
      // don't opt out of the tag we want to fire
      if (tag_list[i] != tag_id) {
        arr.push(utag.loader.cfg[tag_list[i]]['tid'] + &quot;:0&quot;);
      // opt out of the other tags
      } else {
        arr.push(utag.loader.cfg[tag_list[i]]['tid'] + &quot;:1&quot;)
      }
    }

    // join and fake the cookie
    b['cp.OPTOUTMULTI'] = encodeURIComponent(arr.join(&quot;|&quot;));

  }
}

